INSERT INTO `kommentar` (`kommentar_id`, `type_id`, `relation_id`, `kommentar`, `created_timestamp`, `created_userName`) VALUES
(1, 2, 4, 'Vi vil gerne tage egne vandprøver i sensommeren. Hvis muligt send venligst info', '2016-05-23 10:52:49', '{ Excel }'),
(2, 2, 20, 'vi vil gerne tage vandprøven i sensommeren, så send venligst materiale på forhånd', '2016-05-23 10:52:54', '{ Excel }'),
(3, 2, 49, 'Booket sammen med Heidi Nystrand. Oprindelig sagsnr. F14-01', '2016-05-23 10:53:01', '{ Excel }'),
(4, 2, 55, 'Én elev gennemgår en stor operation i ryggen 1-2 mdr inden besøget og må forventes at få lidt lang snor mht evnen til at sidde på en stol osv.', '2016-05-23 10:53:03', '{ Excel }'),
(5, 2, 56, 'Ombooket, læreren HAR modtaget indsamlingskit, men pgha efterårsferie ændrede han datoen', '2016-05-23 10:53:03', '{ Excel }'),
(6, 2, 60, 'Klassen er 3y BI.', '2016-05-23 10:53:04', '{ Excel }'),
(7, 2, 61, 'Vi har to A niveau hold med 2g med 8 elever og 3g med 25 elever', '2016-05-23 10:53:04', '{ Excel }'),
(8, 2, 64, 'Holdet er et hf-enkeltfagshold på B-niveau - Altså vokse kursister!', '2016-05-23 10:53:05', '{ Excel }'),
(9, 2, 65, 'bio b.', '2016-05-23 10:53:06', '{ Excel }'),
(10, 2, 78, 'Det er en dygtig klasse.', '2016-05-23 10:53:09', '{ Excel }'),
(11, 2, 79, 'Henvisning til sag F14-13 Vi havde ikke skrevet den korrekte dato i vores kalender. Vi har desuden en elev, der er nyligt rygopereret, som nok ikke kan sidde ned så længe af gangen. Bare så der er forståelse for, at hun evt. går rundt, ligger ned eller lignende', '2016-05-23 10:53:09', '{ Excel }'),
(12, 2, 82, 'Vi har haft en del datobytningsforvirring, som også har involveret parallelholdet i biologi med Maria Steinhausen - også fra Helsingør Gymnasium. Det betyder ikke så meget, udover at jeg gerne vil bemærke, at vores prøver er de, som er taget fra "Politisøen" i Helsingør. Så lad ikke booking-koden forlede Jer til at tro, at vi skal behandle Maria Steinhausens prøver :-) hilsen OLe Carsten Pedersen', '2016-05-23 10:53:10', '{ Excel }'),
(13, 2, 83, 'Klassen har biologi på B-niveau', '2016-05-23 10:53:10', '{ Excel }'),
(14, 2, 86, '1 ekstra hold på 18 elever fra samme gym er tilmeldt. Booking ændret d. 14. august 2014', '2016-05-23 10:53:11', '{ Excel }'),
(15, 2, 87, '1 ekstra hold på 18 elever fra samme gym er tilmeldt. Booking ændret d. 14. august 2014', '2016-05-23 10:53:11', '{ Excel }'),
(16, 2, 91, 'Det er et hold fra læreruddannelsen, der har biologi som undervisningsfag. Tager kontakt pr. mail. Vigtigt for mig at få reserveret dagen i første omgang', '2016-05-23 10:53:13', '{ Excel }'),
(17, 2, 92, 'Biologi studieretning A niveau', '2016-05-23 10:53:14', '{ Excel }'),
(18, 2, 96, 'Det er et hold der kommer ind Det er mange elever, men de er meget rolige', '2016-05-23 10:53:15', '{ Excel }'),
(19, 2, 97, 'Det er et hold der kommer ind Det er mange elever, men de er meget rolige', '2016-05-23 10:53:15', '{ Excel }'),
(20, 2, 101, '2 hold. Det ene hold 2g (9 elever) det andet hold 3g (11 elever). Begge hold på A-niveau. ', '2016-05-23 10:53:16', '{ Excel }'),
(21, 2, 115, 'OBS: to klasser fra to forskellige gymnasier. De skal have tilsendt to kits. Det ene til Køge, det andet til Tine Tønnes SørensenHøng Gymnasium og HFHovedgaden 2 4270 Høng', '2016-05-23 10:53:20', '{ Excel }'),
(22, 2, 119, 'Almindelig ''Papegøjeklasse'' med sproglige elever', '2016-05-23 10:53:22', '{ Excel }'),
(23, 2, 122, 'Vi kommer med 2 klasser, en biotek A på 11 elever og en Biologi C på 19 elever. Jeg er lærer for dem begge og vil sørge for at de har hørt om DNA og PCR forinden. 1 elev er kørestolsbruger, som har en medhjælper med.', '2016-05-23 10:53:22', '{ Excel }'),
(24, 2, 134, 'Jeg har fået et vandopsamlingssæt udleveret på Big Bang konferencen. Jeg sender noget vand ind i slutningen af april.', '2016-05-23 10:53:26', '{ Excel }'),
(25, 2, 136, 'Den anden lærer er kemilærer i bioteknologi, og hedder Jens Sveistrup', '2016-05-23 10:53:26', '{ Excel }'),
(26, 2, 138, 'Holdet jeg tænker på er 2g Biologi B , der er 12 elever. Imidlertid kunne jeg tænke mig også at deltage samtidigt med 12 Biologi A-elever . Begge dele kræver imidlertid godkendelse fra skolen som jeg straks vil forespørge om Dvs jeg ønsker at reservere dagen. Skulle dagen være optaget vil torsdag d 3 eller fre d 4-9 / uge 36 også være interessant mvh bente bregnbak.', '2016-05-23 10:53:27', '{ Excel }'),
(27, 2, 146, 'Jeg kender ikke klassens størrelse endnu', '2016-05-23 10:53:29', '{ Excel }'),
(28, 2, 147, 'Jeg kender ikke klassens størrelse endnu', '2016-05-23 10:53:29', '{ Excel }'),
(29, 2, 148, 'Klassen har i april underøgt søens kvalitet ved undersøgelse af plante- og dyreliv, iltmåling, BI5, sigtdybde mm Undersøgelsen er del af et løbende samarbejde mellem Allerød Gymnasium og Grundejerforeningen omkring søen, som glæder sig til at høre resultatet af eDNA analyserne', '2016-05-23 10:53:29', '{ Excel }'),
(30, 2, 154, 'Aftalt starttidspunkt 9.30 (ved Andreas)', '2016-05-23 10:53:31', '{ Excel }'),
(31, 2, 159, 'Vi har tidligere booket en forløb, men måtte aflyse, og har derfor genbooket._x000D_ Vi har indsendt vandprøver. Det oprindelige bookingnummer var F14-85.', '2016-05-23 10:53:32', '{ Excel }'),
(32, 2, 167, 'Der er tale om to studieretninger: Biologi og bioteknologi', '2016-05-23 10:53:34', '{ Excel }'),
(33, 2, 168, 'Klassen er på en naturvidenskabelig studieretning med Bio A, kemi B og Mat B og er generelt både dygtige og ambitiøse udi det naturvidenskabelige så bare fyld på:-)', '2016-05-23 10:53:35', '{ Excel }'),
(34, 2, 169, 'Klassen er på en naturvidenskabelig studieretning med Bio A, kemi B og Mat B og er generelt både dygtige og ambitiøse udi det naturvidenskabelige så bare fyld på:-)', '2016-05-23 10:53:35', '{ Excel }'),
(35, 2, 171, '1 hørehæmmet elev. Evt. følger tolk med', '2016-05-23 10:53:36', '{ Excel }'),
(36, 2, 172, 'Der er en hørehæmmet elev i klassen, så der vil evt. være en tolk med. Jeg har haft sendt en tilmelding før sommerferien, som jeg afbestilte igen. Jeg fik tilsendt prøverør mv. inden jeg fik afbestilt. Så hvis vi skal indsamle vandprøve, har jeg fået et kit. Vi skal rejse retur til Vejle fredag eftermiddag med DSB frirejse. Jeg har endnu ikke fået billetterne. Er der mulighed for, at vi kan starte lidt tidligere, hvis det bliver vanskeligt at få det til at hænge sammen med vores hjemrejse?', '2016-05-23 10:53:36', '{ Excel }'),
(37, 2, 177, 'Biologi A', '2016-05-23 10:53:37', '{ Excel }'),
(38, 2, 178, 'Biologi A', '2016-05-23 10:53:38', '{ Excel }'),
(39, 2, 181, 'Vi har i foråret indsamlet og indsendt prøve fra vores lokalområde, Kulsbjerg - og det håber vi jo meget at vi selv kan komme til at analysere!', '2016-05-23 10:53:38', '{ Excel }'),
(40, 2, 182, 'Klassen har biologi på B-niveau.', '2016-05-23 10:53:39', '{ Excel }'),
(41, 2, 188, 'Dette er et IB biologi hold og de skal meget gerne undervises på engelsk; material behøver ikke at være på engelsk, da alle har modtaget undervisning i sporget dansk.', '2016-05-23 10:53:40', '{ Excel }'),
(42, 2, 190, 'Incl 8 elever fra Aurehøj', '2016-05-23 10:53:41', '{ Excel }'),
(43, 2, 192, 'Meget gerne det forløb om livet i drikkevand, da det passer bedre til hvad klassen har om for tiden, som netop er bakterier i vores omgivelser, og som organisme', '2016-05-23 10:53:41', '{ Excel }'),
(44, 2, 193, 'biologi B niveau Vi indsamler DNA i august, har et prøvesæt!', '2016-05-23 10:53:42', '{ Excel }'),
(45, 2, 200, 'Klassen kender de grundlæggende DNA-teknikker.  ', '2016-05-23 10:53:44', '{ Excel }'),
(46, 2, 203, 'Ombooket, fra F15-018. Vi vil gerne se på prøver fra Bølle Sø eller Avn Sø, prøver er sendt ind fra Gorm Clausen DL_F15-018_2', '2016-05-23 10:53:45', '{ Excel }'),
(47, 2, 209, 'Dette er en ombookning. Oprindeligt skulle vi komme d. 28.1, så blev det d. 22.1 og nu altså den 21.1. Vores oprindelige bookingnummer DL_F14-96 Vi har indsendt prøver både fra en sø og fra vandhanevand.', '2016-05-23 10:53:47', '{ Excel }'),
(48, 2, 215, 'En Team Danmark klasse som har morgentræning denne dag, så hvis øvelsesstarten kan rykkes til kl. 9.30- 9.45 vil det være fint.', '2016-05-23 10:53:48', '{ Excel }'),
(49, 2, 216, 'Klassen har biologi på B-niveau', '2016-05-23 10:53:49', '{ Excel }'),
(50, 2, 218, 'Dagen er booket som en del af et projekt vi kalder "Superbiologer". Eleverne kommer fra 8 forskellige 1. hf klasser - og de har meldt sig frivilligt til arrangementet. Da eleverne kommer fra 8 forskellige klasser (med forskellige lærere) har de ikke haft en fælles introduktion til dagen. Alle eleverne kender til cellers opbygning, DNA''s opbygning og har lavet forsøg med elektroforese. De har biologi på C-niveau._x000D__x000D_Inden sommerferien sendte jeg vandprøver til jer._x000D__x000D_Mvh Helle ', '2016-05-23 10:53:50', '{ Excel }'),
(51, 2, 220, 'Vi er to A-niveau hold. Det ene hold (9 elever) har biologi på A-niveau og det andet hold (16 elever) har bioteknologi på A-niveau._x000D__x000D_Vi kommer fra Kolding i Jylland, men den kommune findes ikke i jeres oversigt. Betyder det at jyder ikke kan få adgang til jeres undervisning???_x000D__x000D_Venlig hilsen_x000D_Merete Greniman', '2016-05-23 10:53:50', '{ Excel }'),
(52, 2, 223, 'Gymnasietjenesten/BEKL: Oprindeligt forløb den 13/11-2015 rykket til 24/2 efter henvendelse fra lærer. Lærers bemærkninger 12/10-2015: ”Klassen har biologi på B-niveau. Vi har taget vandprøve fra Schweizersøen i Frederiksberg Have, som vi sendte til jer den 30/9. På den er vores besøgsdato markeret som 13/11. Vi mangler endnu at tage prøven fra gymnasiets postevand', '2016-05-23 10:53:51', '{ Excel }'),
(53, 2, 224, 'den med ferskvandsdyr i søer (Furesøen): livet i et snapseglas', '2016-05-23 10:53:51', '{ Excel }'),
(54, 2, 227, 'Klassen har den basale viden om genetik inden besøget.', '2016-05-23 10:53:52', '{ Excel }'),
(55, 2, 228, 'Biologi B', '2016-05-23 10:53:52', '{ Excel }'),
(56, 2, 229, 'Eleverne har Biologi A i studieretningen. Der er to udvekslingsstudenter (en fra USA og en fra Argentina)', '2016-05-23 10:53:53', '{ Excel }'),
(57, 2, 232, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.', '2016-05-23 10:53:54', '{ Excel }'),
(58, 2, 233, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.', '2016-05-23 10:53:54', '{ Excel }'),
(59, 2, 234, 'Eleverne er en masterclass i biologi og bioteknologi, hvor eleverne kommer fra Silkeborg, Svendborg og Næstved Gymnasium. De er dygtige og vil gerne udfordres. Hvis I har et ekstra fagligt gear må I gerne bruge det.', '2016-05-23 10:53:54', '{ Excel }'),
(60, 2, 235, 'Jeg har rettet denne booking til d. 10/3 fra en tidligere booking d. 3/3 - efter mailhenvendelse fra læreren. /Mia 17/11', '2016-05-23 10:53:54', '{ Excel }'),
(61, 2, 237, 'Jeg skal nok have gennemgået alt det faglige relevante for klassen inden besøget. Vh Bo', '2016-05-23 10:53:56', '{ Excel }'),
(62, 2, 238, 'OBS! Prøve: DL_GYM_008, indsamlet d. 7.6.2015 af Niels J. Willumsen. To hold: 3.g biotek 19 elever, 1.g biologi 11 elever', '2016-05-23 10:53:56', '{ Excel }'),
(63, 2, 239, 'Det bliver en studieretningsklasse med Biologi på A-niveau, og matenmatik på A og kemi på B. Klassen er ikke dannet endnu. Det sker først efter nytår, så derfor kan jeg ikke angive antal elever præcist, men det bliver sikkert en hel klasse. ', '2016-05-23 10:53:56', '{ Excel }'),
(64, 2, 240, 'Biologi A, KemiB sk´tudieretning._x000D_Da vi kommer med tog fra Helsinge vil vi gerne starte 9.15 hvis det er muligt ', '2016-05-23 10:53:57', '{ Excel }'),
(65, 2, 241, 'Der er tale om et valgfag Biologi på B-niveau. Der er enkelte kursister som er 1. års elever. Da valgfaget netop er startet op (januar 2016) er kursisttallet forbundet med en smule usikkerhed. På nuværende tidspunkt er der tilmeldt 32 til holdet. Er det i orden at give et kursisttal per 1. marts 2016?', '2016-05-23 10:53:57', '{ Excel }'),
(66, 2, 242, 'Jeg skal nok have gennemgået alt det faglige relevante for klassen inden besøget. Vh Bo', '2016-05-23 10:53:58', '{ Excel }'),
(67, 2, 243, 'Vi glæder os.   Vh.  Peter Jensen. ', '2016-05-23 10:53:58', '{ Excel }'),
(68, 2, 248, 'Har ej indsendt prøver (men prøve indsendt af Vagn Rasmussen, Allerød; DL_GYM_010 /Marie)', '2016-05-23 10:53:59', '{ Excel }'),
(69, 2, 249, 'Forløbet kommer til at afslutte et forløb om økologi, samt være opsummering på teori om evolution, DNAreplikation og proteinsyntese.', '2016-05-23 10:54:00', '{ Excel }'),
