(72, 2, 255, 'Jeg har booket en dato den 10. december som jeg gerne vil aflyse, men jeg har i den forbindelse allerede modtaget et indsamlingskit. Mange hilsner Katrine', '2016-05-23 10:54:01', '{ Excel }'),
(73, 2, 259, 'Vi har ikke selv vandprøve med, men benytter jeres. er det ok?_x000D_\nBekræftet"', '2016-05-23 10:54:02', '{ Excel }'),
(74, 2, 261, 'Klassen er en international IB klasse, så det normale undervisnings sprog for dem er engelsk, men de fleste forstår noget dansk. Så ligesom sidst vi var på besøg kunne det være fantastisk med samme material (på dansk) men selve underviningen på engelsk? mvh, Christina', '2016-05-23 10:54:03', '{ Excel }'),
